import React from 'react';
import classes from '../VideoCard/VideoCard.module.css';


const VideoCard = (props) =>{
return(
    <div className={classes.VideoCard} >
    <h3 >OrderID - {props.id}</h3>
    <h3 >CustomerName - {props.customerName}</h3>
    <h3 >OrderDate -{props.orderDate}</h3>
    <h3 >Amount -{props.amount}</h3>
  <h3 >OrderStatus -{props.orderStatus}</h3>
  
    
    </div>
)
}
export default VideoCard;
